const EducationItem = ({ degree, institution, year, description }) => (
    <div className='education-item'>
      <h3>{degree}</h3>
      <p><strong>{institution}</strong></p>
      <p><i>{year}</i></p>
      <p>{description}</p>
    </div>
  );
